import Layout from "./Layout";

function App() {
  const [darkMode, setDarkMode] = useState(false);

  const changeMode = () => {
    setDarkMode(!darkMode);
  };

  return (
    <main className={`${darkMode && "dark"}`}>
      <Layout />
    </main>
  );
}

export default App;
